import { AppBar, Toolbar, Typography, Box, Button } from "@material-ui/core";
import * as authSelectors from "../redux/auth/authSelectors";
import { urls } from "../routes";
import { connect } from "react-redux";
import NavLink from "./NavLink";
import * as authOperations from '../redux/auth/authOperations'

function Navbar({ isAuthenticated, logout, user }) {
  return (
    <div>
      <AppBar position="fixed">
        <Toolbar>
          <Box mr="auto">
            <Typography variant="button" component="div">
              <NavLink to={urls.home}>Home</NavLink>
              {isAuthenticated && (
                <NavLink to={urls.contacts}>Contacts</NavLink>
              )}
              {!isAuthenticated && (
                <>
                  <NavLink to={urls.register}>Register</NavLink>
                  <NavLink to={urls.login}>Login</NavLink>
                </>
              )}
            </Typography>
          </Box>
          {isAuthenticated && (
          <Box>
            <Typography variant="body1" component="span">
              Logged in as user
            </Typography>
            <Button variant="text" color="inherit" onClick={logout}>
              Logout
            </Button>
          </Box>
          )}
        </Toolbar>
      </AppBar>

      <Toolbar />
    </div>
  );
}



const mapDispatchToProps = {
  logout: authOperations.logout
}


const mapStateToProps = (state) => ({
  isAuthenticated: authSelectors.isAuthenticated(state),
});

export default connect(mapStateToProps, map)(Navbar);
